const AddRecipePage = ({ themeClasses }) => {
    const [recipeImage, setRecipeImage] = useState(null);
    const [recipeImagePreview, setRecipeImagePreview] = useState(null);

    const handleRecipeImageChange = (e) => {
        if (e.target.files && e.target.files[0]) {
            const file = e.target.files[0];
            setRecipeImage(file);
            
            const reader = new FileReader();
            reader.onloadend = () => {
                setRecipeImagePreview(reader.result);
            };
            reader.readAsDataURL(file);
        }
    };

    const handleSaveRecipe = () => {
        alert('Recipe saved! (Feature coming soon - this will integrate with backend storage)');
    };

    return (
        <div className="w-full max-w-4xl mx-auto space-y-8 p-6">
            <h2 className={`text-4xl font-extrabold text-center ${themeClasses.subheading}`}>Create a New Recipe 📝</h2>
            <div className={`p-8 rounded-2xl shadow-xl ${themeClasses.infoBox} transition-colors duration-500 space-y-6`}>
                <p className={`${themeClasses.listText} text-lg text-center`}>
                    This page is dedicated to user-generated recipes. You can manually enter ingredients, instructions, nutritional facts, and upload an image to save your favorite custom meals.
                </p>
                
                <div className="space-y-6">
                    {/* Image Upload Section */}
                    <div className="flex flex-col items-center space-y-4">
                        <label className={`block text-lg font-semibold ${themeClasses.text}`}>Recipe Image</label>
                        
                        {recipeImagePreview && (
                            <div className="relative w-full max-w-md">
                                <img 
                                    src={recipeImagePreview} 
                                    alt="Recipe preview" 
                                    className="w-full h-64 object-cover rounded-xl shadow-lg"
                                />
                                <button
                                    onClick={() => {
                                        setRecipeImage(null);
                                        setRecipeImagePreview(null);
                                    }}
                                    className="absolute top-2 right-2 bg-red-500 hover:bg-red-600 text-white rounded-full p-2 shadow-lg transition-colors"
                                    aria-label="Remove image"
                                >
                                    <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M6 18L18 6M6 6l12 12" /></svg>
                                </button>
                            </div>
                        )}
                        
                        <input
                            type="file"
                            onChange={handleRecipeImageChange}
                            accept="image/*"
                            className={`block w-full text-sm text-gray-500 file:mr-4 file:py-2 file:px-4 file:rounded-full file:border-0 file:text-sm file:font-semibold ${themeClasses.input} transition-colors duration-500`}
                        />
                    </div>

                    {/* Basic Info */}
                    <div className="grid md:grid-cols-2 gap-6">
                        <input 
                            type="text" 
                            placeholder="Recipe Title" 
                            className={`p-3 rounded-lg border-2 ${themeClasses.card} ${themeClasses.text}`}
                        />
                        <input 
                            type="number" 
                            placeholder="Total Servings" 
                            min="1"
                            className={`p-3 rounded-lg border-2 ${themeClasses.card} ${themeClasses.text}`}
                        />
                    </div>

                    {/* Ingredients */}
                    <div>
                        <label className={`block text-lg font-semibold mb-2 ${themeClasses.text}`}>Ingredients</label>
                        <textarea 
                            placeholder="Enter ingredients (one per line)&#10;Example:&#10;2 cups flour&#10;1 cup sugar&#10;3 eggs" 
                            rows="8" 
                            className={`w-full p-3 rounded-lg border-2 ${themeClasses.card} ${themeClasses.text}`}
                        />
                    </div>

                    {/* Instructions */}
                    <div>
                        <label className={`block text-lg font-semibold mb-2 ${themeClasses.text}`}>Cooking Instructions</label>
                        <textarea 
                            placeholder="Enter step-by-step cooking instructions&#10;Example:&#10;1. Preheat oven to 350°F&#10;2. Mix dry ingredients in a bowl&#10;3. Add wet ingredients and stir until combined&#10;4. Bake for 25-30 minutes" 
                            rows="10" 
                            className={`w-full p-3 rounded-lg border-2 ${themeClasses.card} ${themeClasses.text}`}
                        />
                    </div>

                    {/* Nutritional Information */}
                    <div>
                        <label className={`block text-lg font-semibold mb-3 ${themeClasses.text}`}>Nutritional Information (per serving)</label>
                        <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
                            <input type="number" placeholder="Calories" step="0.1" className={`p-3 rounded-lg border-2 ${themeClasses.card} ${themeClasses.text}`} />
                            <input type="number" placeholder="Protein (g)" step="0.1" className={`p-3 rounded-lg border-2 ${themeClasses.card} ${themeClasses.text}`} />
                            <input type="number" placeholder="Carbs (g)" step="0.1" className={`p-3 rounded-lg border-2 ${themeClasses.card} ${themeClasses.text}`} />
                            <input type="number" placeholder="Fat (g)" step="0.1" className={`p-3 rounded-lg border-2 ${themeClasses.card} ${themeClasses.text}`} />
                        </div>
                    </div>

                    {/* Save Button */}
                    <button 
                        onClick={handleSaveRecipe}
                        className={`w-full px-6 py-3 rounded-full text-white font-bold bg-green-600 hover:bg-green-700 transition-transform transform hover:scale-105 shadow-lg text-lg flex items-center justify-center`}
                    >
                        <svg className="w-5 h-5 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M8 7H5a2 2 0 00-2 2v9a2 2 0 002 2h14a2 2 0 002-2V9a2 2 0 00-2-2h-3m-1 4l-3 3m0 0l-3-3m3 3V4" /></svg>
                        Save Custom Recipe
                    </button>
                </div>
            </div>
        </div>
    );
};
